const getTrack = async (trackName, artist) => {
    const response = await fetch(
        `https://api.spotify.com/v1/search?q=${trackName}%20${artist}&type=track`,
        {
            method: "GET",
            headers: {
                Authorization: `Bearer ${access_token}`,
            },
        }
    );
    const data = await response.json();
    return data;
};

