const output = yash_history.map(async (item) => {
    const { trackName, artistName } = item;
    const data = await getTrack(trackName, artistName);
    const { items } = data.tracks;
    if (items.length > 0) {
        const uri = items[0].external_urls.spotify;
        return { ...item, uri };
    }
});

Promise.all(output).then((data) => {
    console.log(data);
    // Save the data to a json file
    var json = JSON.stringify(data);
    fs.writeFile('data/yash_history_with_spotify_data.json', json, 'utf8', function(err) {
        if (err) throw err;
        console.log('complete');
    });
});

    







